INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL91019PL', 'Tecnologia', 'Gadgets', 'Kit de lentes para smartphone, cuenta con 4 tipos diferentes de lentes. Esto incluye lente de ojo de pez, lente amplia, lente macro y lente CPL (que elimina la luz dispersa y produce una imagen mas natural). Simplemente coloque el lente en su telefono inteligente y gire la base para probar los 4 lentes diferentes.', 0, 0, '-', '-', '-', '-', 'PPM');
INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL91021PL', 'Tecnologia', 'Gadgets', 'Convierta la camara de su telefono inteligente en un telescopio con Zoom 8x. Realice la toma perfecta de larga distancia o una foto de cerca. El clip se adapta a la mayoria de los smarthphones.', 142.52, 142.52, '-', '-', '-', '-', 'PPM');
INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL92003PL', 'Tecnologia', 'Gadgets', 'Drone a control remoto con tecnologia WiFi. A traves de la aplicacion podras observar en tiempo real la imagen que el dron captura mientras vuela y guardar tus imagenes y videos. Incluye camara HD de 720P para hacer tomas aereas de gran calidad. Capacidad de vuelo de hasta 262 pies de altura. Tiempo de vuelo de 7 minutos con una sola carga. Tiempo de carga de la bateria: 40 minutos.', 1597.54, 1597.54, '17.7', '17.7', '3.1', '-', 'PPM');
INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL92005PL', 'Tecnologia', 'Gadgets', 'Camara de accion con lente HD 1080P para capturar cualquier momento. Su bateria de 400 mAh es capaz de grabar hasta 2 horas con una sola carga. La camara de accion de permite tomar fotografias y videos de alta resolucion. Con accesorios adicionales para montaje y soporte. incluye micro cable de carga USB y tarjeta SD de 8GB.', 896.12, 896.12, '3.8', '-', '3.8', '-', 'PPM');
INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL92009PL', 'Tecnologia', 'Gadgets', 'Camara de accion WiFi equipada con un lente HD 1080P y pantalla LCD de 0.96\" para llevar sus fotografias al siguiente nivel. Transmite video en directo desde el dispositivo conectado a la camara 360 a traves de la aplicacion. Capaz de grabar cualquier angulo en alta resolucion con vista panoramica de 360¬∫ ?. Transfiera imagenes de forma inalambrica a su correo electronico, almacenamiento en la nube o a una red social. Incluye carcasa para el agua para sumergir hasta 30 metros y accesorios para montaje y soporte. Cable micro USB de carga incluido. No incluye tarjeta micro SD.', 2101.75, 2101.75, '7.6', '-', '7.6', '-', 'PPM');
